import React, { useState } from 'react'
import '../index.css'

import { Routes, Route, Link } from "react-router-dom";
import { useSelector,useDispatch } from 'react-redux'
import { click } from '../features/notes';
import { toggle } from '../features/categoryBar';

const Catergory = () => {

    const notes = useSelector(state => state.notes.value)
    // const catBar = useSelector(state => state.categoryBar.value)
    // console.log(catBar);
    const dispatch = useDispatch();
    const [btn1Click,setBtn1Click] = useState(true)


    const handleClick1 = event => {
        setBtn1Click(current => !current)
        dispatch(toggle({
            isBtn1Clicked:btn1Click
        }))
    };

    const handleClick2 = event => {
        // setBtn2Click(current => !current)
        dispatch(toggle({
            isBtn2Clicked:true
        }))

    };
    const handleClick3 = event => {
        // setBtn3Click(current => !current)
        dispatch(toggle({
            isBtn3Clicked:true
        }))
    };
    const handleClick4 = event => {
        // setBtn4Click(current => !current)
        dispatch(toggle({
            isBtn4Clicked:true
        }))
    };

    return (
        <>
            {!notes.isNotesClicked ? (
                <>
                    <div className='container-fluid'>
                        <div className="row ">
                            <div className="d-flex flex-row flex-wrap justify-content-around align-items-center cat-bar">

                                <Link className={'btn link btn-sm btn-outline-primary'} id='active' to='/'
                                    onClick={handleClick1}
                                >

                                    Collection
                                </Link>



                                <Link className={'btn link btn-sm btn-outline-primary'} id='active' to='/customer-info'
                                    onClick={handleClick2}
                                >
                                    Customer
                                </Link>

                                <Link className={'btn link btn-sm btn-outline-primary'} id='active' to='/reports'
                                    onClick={handleClick3}
                                >
                                    Reports
                                </Link>

                                <Link className={'btn link btn-sm btn-outline-primary'} id='active' to='/settings'
                                    onClick={handleClick4}
                                >
                                    Settings
                                </Link>

                            </div>
                        </div>

                    </div>
                </>
            ) : ""}
        </>
    )
}

export default Catergory;
